import { useEffect } from 'react'
import { useState } from 'react'

export const Hello = () => {

    const [initialState, setInitialState] = useState([])
    // const [searchTerm, setSearchTerm] = useState('')


    useEffect(() => {
        fetch('/api/').then(res => {
            if (res.ok) {
                return res.json();
            }   
